import { stories } from '../../mockData/stories';
import "./Story.scss";

const Story: React.FC = () => {

  const listStories = stories.map((story) => {
    return (
      <div>
        <h3 className="title">{story.title}</h3>
      </div>
    )
  });

  return (
    <div className="page">
      <h1>Story</h1>
      {}
    </div>
  );
};

export default Story;
